import React from 'react';
import './App.css';

class App extends React.Component{

constructor(props){
  super(props);
  this.userClicked=this.userClicked.bind(this);

}

userClicked(id){

  let tmp = id;

  fetch("https://ti-react-test.herokuapp.com/users/"+tmp,{method:'PATCH',body:JSON.stringify({

           bio:'Civic Techie',
           email:'me@email.com',
           name:'Thenos Hunt',
           occupation:'Hacker'

          }),
      headers:{
        'Content-type':'application/json;charset=UTF-8'
      }
      })
         .then(res => res.json())
         .then((response) => {

             console.log(response);

        })
         .catch(err => {

            console.log(err);

         });


}

render() {

  return (
    <div id='User'  className='User' data-item={this.props.user_id}>
     <div id='header'>
      <label id='name'>{this.props.name.length <= 0 ? 'No Name' : this.props.name}</label>
      <label id='prof'>{this.props.job}</label>
     </div>
     <div id='email'>
      <label>{this.props.email.length <= 0 ? 'No Email' : this.props.email}</label>
     </div>
     <div id='body'>
     <label>Bio...</label>
     <div id='bio_div'>
     <p id='page'>{this.props.bio.length <= 0 ? 'No Bio' : this.props.bio}</p>
     </div>
     </div>
      <button id="btn" onClick={ ()=> this.userClicked(this.props.user_id)} >PATCH</button>
    </div>
  );

}

}

export default App;
